import Customer from './components/Customer';
import './App.css';

const customer = {
  id: 1,
  image: 'https://placeimg.com/64/64/any',
  name: '홍길동',
  birthday: '961222',
  gender: '남자',
  job: '대학생',
}

const App = () => {
  const {name, birthday, gender, job} = customer;

  return (
    <Customer
      name={name}
      birthday={birthday}
      gender={gender}
      job={job}
    />
  );
}

export default App;
